import { AppShell } from '@mantine/core';
import { useState } from 'react';
import Header from '../components/Header';
import Feed from '../components/Feed';

function Main() {
  const [opened, setOpened] = useState(false);

  return (
    <AppShell
      fixed
      header={<Header height={90} padding='md' />}
    >
      <Feed />
    </AppShell>
  );
}

export default Main;
